import React from 'react';

function Recipe() {
    return (
        <div>
            <h1>Title</h1>
            <h3>Description</h3>
            <h4>Time</h4>
            <h4>Amount</h4>
            <h4>Price</h4>
            <ul>
                <li>Ingridient</li>
            </ul>
        </div>
    );
}

export default Recipe;
